import React from "react";
import Slider from "react-slick";
import ava01 from "../../assets/images/ava1.jpg";
import ava02 from "../../assets/images/ava2.jpg";
import ava03 from "../../assets/images/ava3.jpg";

const Testimonial = () => {
  return (
    <Slider>
      <div className="testimonial py-4 px-3">
        <p>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Expedita
          tempore minima veritatis non amet eveniet, distinctio alias recusandae
          velit, laboriosam perferendis quos porro sed cupiditate eum error in
          enim dolore.
        </p>
      </div>
    </Slider>
  );
};

export default Testimonial;
